import React, { Component } from "react";
import axios from "axios";

class HttpRequests extends Component {
  constructor(props) {
    super(props);
    this.state = {
      espacioID: "",
      placa: '',
      espaciosDisponibles: [],
      espaciosOcupados: [],
    };
  }
  clickMe() {
    alert("You clicked me!");
  }

  espaciosOcupados() {
    axios
      .get("https://jsonplaceholder.typicode.com/posts")
      .then((response) => {
        let data = response.data;

        this.setState({ espaciosOcupados: data });
        console.log(this.state.espaciosOcupados);
      })
      .catch((error) => console.log(error));
  }

  espaciosDisponibles() {
    axios
      .get("https://jsonplaceholder.typicode.com/posts")
      .then((response) => {
        let data = response.data;

        this.setState({ espaciosDisponibles: data });
        console.log(this.state.espaciosDisponibles);
      })
      .catch((error) => console.log(error));
  }

  reservarEspacio() {}

  changeHandlerReservar = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };

  submitHandlerReservar = (e) => {
    e.preventDefault();
    axios
      .post("https://jsonplaceholder.typicode.com/posts", this.state.placaVehiculo)
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  changeHandlerLiberar = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };

  submitHandlerLiberar = (e) => {
    e.preventDefault();
    axios
      .post("https://jsonplaceholder.typicode.com/posts", this.state.placaVehiculo)
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  render() {
    const {placa, espacioID, espaciosDisponibles, espaciosOcupados } = this.state;
    return (
      <>
        <div>
          <h1>Consultar Espacios Disponibles</h1>
          <button onClick={() => this.espaciosDisponibles()}>Consultar</button>
          <div>
            {espaciosDisponibles.length
              ? espaciosDisponibles.map((espacio) => (
                  <div key={espacio.id}>{espacio.title}</div>
                ))
              : null}
          </div>
        </div>
        <div>
          <h1>Consultar Espacios Ocupados</h1>
          <button onClick={() => this.espaciosOcupados()}>Consultar</button>
          <div>
            {espaciosOcupados.length
              ? espaciosOcupados.map((espacio) => (
                  <div key={espacio.id}>{espacio.title}</div>
                ))
              : null}
          </div>
        </div>
        <div>
          <h1>Reservar Espacio</h1>
          <div>
              <form onSubmit={this.submitHandlerReservar}>
                <h3>Ingrese el ID del espacio</h3>

                <input
                  type="number"
                  name="placa"
                  value={placa}
                  onChange={this.changeHandlerReservar}
                />
                <button type="submit">Reservar</button>
              </form>
            </div>
        </div>
        <div>
          <h1>Liberar Espacios</h1>
          <div>
            <div>
              <form onSubmit={this.submitHandlerLiberar}>
                <h3>Ingrese el ID del espacio</h3>

                <input
                  type="number"
                  name="espacioID"
                  value={espacioID}
                  onChange={this.changeHandlerLiberar}
                />
                <button type="submit">Liberar</button>
              </form>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default HttpRequests;
